import React, { useState, useEffect } from "react";
import axios from "axios";
import "./payment.css";

export default function WithdrawHome (props){

    var tid = localStorage.getItem("teacherID");
  
const [details, setDetails] = useState([]);

console.log(details);

  useEffect(() => {
    function getdetails() {
      axios
        .get("http://localhost:3000/withdrawPayment/" + tid)
        .then((res) => {
            setDetails(res.data);
        })
        .catch((err) => {
          alert(err.message);
        });
    }
    getdetails();
  }, []);
    
     
    return(
        
        
        <div className="WithdrawHome">
            
            {details.map((item) => (
            
            <div>
              <p>{item.Request_date}</p>
              <p>{item.Withdraw_amout}</p>
              <p>{item.State}</p>
              <div>
              if(item.State=='pending'){
                  <div>
                  <button className="wdh2" onClick={() => props.history.push("/withdraw")}>
                  Payment Withdrawal </button><br/>
                  </div>
              }else if(item.State==NULL){
                <div>
                <button className="wdh1" onClick={() => props.history.push("/bank/")}>
                Bank Details</button><br/>
                </div>
              }




              </div>
            </div>
              
              
            
           ))}
            
            <button className="backbtn" onClick={() => props.history.push("/WithdrawHome")}>
        Back</button>
            <h1 className="Withdrawhomeh1" >Payment Withdraw</h1>
            <button className="wdh1" onClick={() => props.history.push("/bank/")}>
                Bank Details</button><br/>
            <button className="wdh2" onClick={() => props.history.push("/withdraw")}>
                Payment Withdrawal </button><br/>
            <button className="wdh3" onClick={() => props.history.push("/WithdrawPayment")}>
                Payments</button><br/>
            
    </div>
    )
  }
